import { Link } from 'react-router-dom';
import About from './pages/About';

function App() {
  return (
      <Router>
        <nav>
            <ul>
              <li>
                <Link to="/">Home</Link>
              </li>
            <li>
              <Link to ="/about">About</Link>
            </li>
            </ul>
            </nav>
            <switch>
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
            </switch>
      </Router>
  );
}

export default App;
